const DEPTH = 3;
const MIN = -200000;
const MAX = 200000;

class TurochampAlgo {
  constructor(game) {
    this.game = game;
  }

  getEvaluation() {
    const t = this.game.turn();
    this.game.setTurn("w");
    let val = this._getPositionalValue() + 100 * this._getMaterialValue();
    this.game.setTurn(t);
    return val;
  }

  findNextMove() {
    if (this.game.turn() != "w") return null;

    let maxValue = -20000;
    let maxValueMove = null;

    const moves = this.game.moves({ verbose: true });

    for (const move of moves) {

      let val = this._alphaBetaSearch(move, 1, MIN, MAX, false) * 100;
      this.game.move(move);
      val += this._getPositionEvaluation();
      val += this._countKingSafetyScore(move);
      val += this._isCheckMateThreat() ? 1 : 0;
      this.game.undo();

      if (maxValue <= val) {
        maxValue = val;
        maxValueMove = move;
      }

    }


    return maxValueMove;
  }

  _alphaBetaSearch(move, currDepth, alpha, beta, isMax) {

    if (currDepth > DEPTH) {
      this.game.move(move);
      const mval = this._getMaterialValueSub();
      this.game.undo();
      return mval;
    }

    let considerableMoves = 0;
    this.game.move(move);

    if (isMax) {
      let best = MIN;

      for (const m of this.game.moves({ verbose: true })) {
        if (m.flags === "c" || m.flags === "e") {
          considerableMoves++;
          let val = this._alphaBetaSearch(
            m,
            currDepth + 1,
            alpha,
            beta,
            false
          );
          best = Math.max(best, val);
          alpha = Math.max(alpha, best);

          if (beta <= alpha) break;
        } else {
          let val = this._getMaterialValueSub();
          best = Math.max(best, val);
          beta = Math.max(beta, best);
          if (beta <= alpha) break;
        }
      }

      if (considerableMoves == 0) {
        // No considerable moves available, thus dead position
        const matval = this._getMaterialValueSub();
        this.game.undo();
        return matval;
      }

      this.game.undo();
      return best;
    } else {
      let best = MAX;

      for (let m of this.game.moves({ verbose: true })) {
        if (m.flags === "c" || m.flags === "e") {
          considerableMoves++;
          let val = this._alphaBetaSearch(
            m,
            currDepth + 1,
            alpha,
            beta,
            true
          );
          best = Math.min(best, val);
          beta = Math.min(beta, best);
          if (beta <= alpha) break;
        } else {
          let val = this._getMaterialValueSub();
          best = Math.min(best, val);
          beta = Math.min(beta, best);
          if (beta <= alpha) break;
        }
      }

      if (considerableMoves == 0) {
        // No considerable moves, thus dead position
        const matval = this._getMaterialValueSub();
        this.game.undo();
        return matval;
      }

      this.game.undo();

      return best;
    }
  }
  _getPositionEvaluation() {

    const t = this.game.turn();
    this.game.setTurn("w");
    let val = this._getPositionalValue();
    this.game.setTurn(t);

    return val;
  }
  _getPositionalValue() {

    let value = 0;

    let criteria1 =
      this._countRootNumberOfMoves("q") +
      this._countRootNumberOfMoves("b") +
      this._countRootNumberOfMoves("r") +
      this._countRootNumberOfMoves("n");

    value += criteria1;

    let criteria2 =
      this._countDefendersOfPiece("n") +
      this._countDefendersOfPiece("b") +
      this._countDefendersOfPiece("r");

    value += criteria2;

    let criteria3 = this._countKingMovesNotCastle();
    value += criteria3;

    let criteria4 = this._countKingExposedScore();
    value -= criteria4;

    let criteria6 = this._countPawnScore();
    value += criteria6;

    value += this._isBlackInCheck() ? 0.5 : 0;

    return value;
  }

  _countRootNumberOfMoves(piece) {

    let value = 0;
    const moves = this.game.moves({ verbose: true });
    for (const move of moves) {
      if (move.color == "w" && move.piece.toLowerCase() == piece) {
        if (move.flags == "c") value += 2;
        else value += 1;
      }
    }

    value = Math.sqrt(value);


    return value;
  }
  _countPawnScore() {

